import React from 'react';

function P_Validacion(){
  return(
    <div className='Validacion_Edad'>
      <div className='Nombre_Empresa'>
        <h1 className='Kaluka'> Kaluka </h1><br></br>
        <h2 className='BEER'> Beer </h2><br></br>
      </div>
      <div class="Contenedor_Acciones"> 
        <div className='fecha_nacimiento'>
          <form>
            <input class="dia" type="number" id="dia" min="1" max="31" placeholder="Día" required></input>
            <input class="mes" type="number" id="mes" min="1" max="12" placeholder="Mes" required></input>
            <input class="año" type="number" id="año" min="1950" max="2024" placeholder="Año" required></input>
            <p class="texto_ingreso"> Ingrese su fecha de nacimiento para poder ingresar</p>
            <input class="ingresar" type="submit" value="Ingresar"></input>
          </form>
        </div>
      </div>

    </div>
      
  ); 
}
export default P_Validacion;
